B.UG=new A.ar('Esta Pol\xedtica de Privacidade se aplica ao jogo "Gri\xf4 AI" e a quaisquer outros servi\xe7os digitais relacionados operados sob a marca do jogo. Inclu\xedmos links para esta Pol\xedtica de Privacidade dentro do jogo e em suas plataformas associadas.\nCaso algum servi\xe7o relacionado ao jogo "Gri\xf4 AI" exija uma pol\xedtica de privacidade \xfanica, essa pol\xedtica prevalecer\xe1 sobre a presente.\n',null,B.al,null,null,null,null,null,null)
