B.U4=new A.ar("2. Informa\xe7\xf5es que Coletamos",null,B.at,null,null,null,null,null,null)
B.UK=new A.ar('Informa\xe7\xf5es fornecidas por voc\xea:\nCria\xe7\xe3o de Conta: Ao criar uma conta no "Gri\xf4 AI", solicitamos seu e-mail, nome de usu\xe1rio e senha.\nIntera\xe7\xf5es no Jogo: Durante a experi\xeancia de jogo, voc\xea pode compartilhar dados relacionados \xe0s suas escolhas narrativas, respostas a desafios e intera\xe7\xf5es com o guia virtual Gri\xf4.\nConte\xfado Adicional: Caso decida enviar imagens, v\xeddeos ou \xe1udios relacionados aos desafios, pediremos acesso \xe0 c\xe2mera e/ou biblioteca de m\xeddia do seu dispositivo.\nInforma\xe7\xf5es coletadas automaticamente:\nDados de Uso: Registramos como voc\xea utiliza o jogo, incluindo progresso nas fases, tempo gasto em cada atividade e intera\xe7\xf5es com o mapa interativo.\nDados T\xe9cnicos: Coletamos informa\xe7\xf5es sobre o dispositivo usado, como modelo, sistema operacional, endere\xe7o IP e configura\xe7\xf5es de idioma.\nLocaliza\xe7\xe3o: Coletamos dados de localiza\xe7\xe3o apenas quando necess\xe1rio para certas mec\xe2nicas do jogo, como explora\xe7\xe3o de mapas hist\xf3ricos.\nInforma\xe7\xf5es de terceiros:\nConex\xf5es de M\xeddia Social: Voc\xea pode optar por acessar o jogo usando uma conta de m\xeddia social. Nesse caso, coletamos informa\xe7\xf5es b\xe1sicas associadas \xe0 conta utilizada.\n',null,B.al,null,null,null,null,null,null)
B.UO=new A.ar("3. Como Usamos as Informa\xe7\xf5es",null,B.at,null,null,null,null,null,null)
B.U5=new A.ar("As informa\xe7\xf5es coletadas s\xe3o utilizadas para:\nMelhorar e personalizar sua experi\xeancia no jogo;\nGarantir o funcionamento correto do jogo e de suas funcionalidades;\nAnalisar o uso do jogo para fins de aprimoramento t\xe9cnico e narrativo;\nEnviar comunica\xe7\xf5es sobre atualiza\xe7\xf5es, eventos ou novas funcionalidades do jogo.\n",null,B.al,null,null,null,null,null,null)
B.TK=new A.ar("4. Como Compartilhamos Informa\xe7\xf5es",null,B.at,null,null,null,null,null,null)
B.Ud=new A.ar('Finalidades do compartilhamento:\nCom provedores de servi\xe7os terceirizados necess\xe1rios para o funcionamento do jogo, como armazenamento em nuvem, hospedagem de servidores e an\xe1lise de dados.\nEm casos de determina\xe7\xe3o legal ou para proteger os direitos do "Gri\xf4 AI".\nCom parceiros culturais, apenas de forma anonimizada, para fins de pesquisa ou divulga\xe7\xe3o de impacto do projeto.\nCompartilhamento Internacional: Seus dados podem ser transferidos para servidores localizados fora do Brasil, sempre garantindo conformidade com a LGPD.\n',null,B.al,null,null,null,null,null,null)
B.UN=new A.ar("5. Seguran\xe7a e Reten\xe7\xe3o dos Dados",null,B.at,null,null,null,null,null,null)
