B.UV=new A.ar("6. Direitos dos Usu\xe1rios",null,B.at,null,null,null,null,null,null)
B.Uo=new A.ar("Voc\xea tem controle sobre suas informa\xe7\xf5es, podendo:\nAcessar, corrigir ou excluir dados fornecidos;\nRestringir ou se opor ao processamento de seus dados;\nEncerrar sua conta e solicitar a exclus\xe3o de informa\xe7\xf5es associadas.\nFerramentas para gerenciamento de dados est\xe3o dispon\xedveis dentro do jogo. Para d\xfavidas ou solicita\xe7\xf5es, entre em contato conosco pelo e-mail: suporte@gri\xf4ai.com.\n",null,B.al,null,null,null,null,null,null)
B.U9=new A.ar("7. Altera\xe7\xf5es nesta Pol\xedtica de Privacidade",null,B.at,null,null,null,null,null,null)
B.Ue=new A.ar("Quaisquer altera\xe7\xf5es nesta pol\xedtica ser\xe3o comunicadas aos usu\xe1rios diretamente no jogo ou via e-mail cadastrado. A vers\xe3o atualizada estar\xe1 dispon\xedvel em: https://gri\xf4ai.com/politica-de-privacidade.\n",null,B.al,null,null,null,null,null,null)
B.Ug=new A.ar("8. Contato",null,B.at,null,null,null,null,null,null)
