B.U7=new A.ar('O "Gri\xf4 AI" \xe9 um jogo educativo digital que promove pesquisa hist\xf3rica e cultural com foco na vida de Mohammed Gardo Baquaqua. Ele combina interatividade, tecnologia e cultura para oferecer uma experi\xeancia imersiva e acess\xedvel.\nO jogo \xe9 disponibilizado exclusivamente online e utiliza mec\xe2nicas baseadas em desafios de pesquisa, conduzidos por uma persona de IA chamada Gri\xf4, inspirada nos contadores de hist\xf3rias da tradi\xe7\xe3o oral africana.\n',null,B.al,null,null,null,null,null,null)
B.Uw=new A.ar("3. Cadastro e Responsabilidades do Usu\xe1rio",null,B.at,null,null,null,null,null,null)
B.Ux=new A.ar('3.1. Requisitos para Cadastro:\nPara usar o "Gri\xf4 AI", voc\xea deve criar uma conta, fornecendo informa\xe7\xf5es verdadeiras, completas e atualizadas.\nO jogo \xe9 destinado a usu\xe1rios com idade igual ou superior a 13 anos. Menores de idade devem ter autoriza\xe7\xe3o de um respons\xe1vel legal para jogar.\n3.2. Obriga\xe7\xf5es do Usu\xe1rio:\nUsar o jogo de forma \xe9tica, respeitando outros jogadores e as normas legais aplic\xe1veis.\nN\xe3o compartilhar sua conta ou credenciais de acesso com terceiros.\nReportar qualquer atividade suspeita ou uso indevido de sua conta imediatamente \xe0 equipe de suporte.\n',null,B.al,null,null,null,null,null,null)
B.UW=new A.ar("4. Uso Permitido",null,B.at,null,null,null,null,null,null)
B.Uq=new A.ar('Ao acessar o "Gri\xf4 AI", voc\xea concorda em:\nUtilizar o jogo exclusivamente para fins pessoais, educativos e n\xe3o comerciais.\nN\xe3o tentar descompilar, copiar, modificar ou hackear o jogo.\nN\xe3o realizar atividades que prejudiquem o funcionamento do jogo, como ataques cibern\xe9ticos, envio de malware ou uso de scripts automatizados.\n',null,B.al,null,null,null,null,null,null)
B.TV=new A.ar("5. Direitos Autorais e Propriedade Intelectual",null,B.at,null,null,null,null,null,null)
B.TX=new A.ar('O jogo "Gri\xf4 AI", incluindo todo o conte\xfado, software, design, personagens e funcionalidades, \xe9 protegido por leis de propriedade intelectual. Voc\xea n\xe3o adquire nenhum direito sobre o jogo, exceto uma licen\xe7a limitada, revog\xe1vel e intransfer\xedvel para utiliz\xe1-lo conforme descrito nestes Termos de Uso.\n\xc9 proibido:\nReproduzir, distribuir ou criar trabalhos derivados do conte\xfado do jogo sem autoriza\xe7\xe3o pr\xe9via.\nUsar a marca "Gri\xf4 AI" ou elementos associados sem permiss\xe3o por escrito.\n',null,B.al,null,null,null,null,null,null)
B.V2=new A.ar("6. Limita\xe7\xe3o de Responsabilidade",null,B.at,null,null,null,null,null,null)
B.Uk=new A.ar('Embora nos esforcemos para oferecer um servi\xe7o de alta qualidade, o "Gri\xf4 AI" \xe9 disponibilizado "no estado em que se encontra", sem garantias expl\xedcitas ou impl\xedcitas.\nN\xe3o garantimos:\nQue o jogo estar\xe1 dispon\xedvel de forma ininterrupta ou livre de erros.\nQue o conte\xfado do jogo atender\xe1 a todas as suas expectativas.\nA equipe do "Gri\xf4 AI" n\xe3o se responsabiliza por:\nDanos diretos ou indiretos resultantes do uso ou incapacidade de usar o jogo.\nPerda de dados ou qualquer outro preju\xedzo relacionado \xe0 sua experi\xeancia no jogo.\n',null,B.al,null,null,null,null,null,null)
B.Ub=new A.ar("7. Privacidade",null,B.at,null,null,null,null,null,null)
B.Um=new A.ar('Ao utilizar o "Gri\xf4 AI", voc\xea concorda com a coleta e o uso de informa\xe7\xf5es conforme descrito em nossa Pol\xedtica de Privacidade.\n',null,B.al,null,null,null,null,null,null)
B.TE=new A.ar("8. Encerramento e Suspens\xe3o de Contas",null,B.at,null,null,null,null,null,null)
B.V1=new A.ar("Reservamo-nos o direito de encerrar ou suspender sua conta, sem aviso pr\xe9vio, caso identifiquemos:\nViola\xe7\xe3o destes Termos de Uso;\nAtividades fraudulentas ou prejudiciais ao funcionamento do jogo ou \xe0 comunidade de jogadores;\nSolicita\xe7\xe3o volunt\xe1ria de encerramento por parte do usu\xe1rio.\n",null,B.al,null,null,null,null,null,null)
B.TL=new A.ar("9. Altera\xe7\xf5es nos Termos de Uso",null,B.at,null,null,null,null,null,null)
B.UY=new A.ar("Podemos atualizar estes Termos de Uso periodicamente. Quaisquer altera\xe7\xf5es ser\xe3o comunicadas diretamente no jogo ou via e-mail cadastrado. O uso cont\xednuo do jogo ap\xf3s tais altera\xe7\xf5es implica aceita\xe7\xe3o dos novos termos.\n",null,B.al,null,null,null,null,null,null)
B.TH=new A.ar("10. Lei Aplic\xe1vel e Foro",null,B.at,null,null,null,null,null,null)
B.UI=new A.ar('Estes Termos de Uso s\xe3o regidos pelas leis brasileiras. Quaisquer disputas relacionadas ao "Gri\xf4 AI" ser\xe3o resolvidas no foro da comarca de sua resid\xeancia, salvo disposi\xe7\xe3o legal em contr\xe1rio.\n',null,B.al,null,null,null,null,null,null)
B.TI=new A.ar("11. Contato",null,B.at,null,null,null,null,null,null)
B.UM=new A.ar("Para d\xfavidas ou quest\xf5es relacionadas a estes Termos de Uso, entre em contato conosco:\nE-mail: contato@mobcontent.com.br\nWebsite: https://gri\xf4ai.com\n",null,B.al,null,null,null,null,null,null)
B.TU=new A.ar('Ao acessar ou usar o jogo "Gri\xf4 AI", voc\xea confirma que leu, compreendeu e concorda com os Termos de Uso acima. Divirta-se explorando a hist\xf3ria e cultura de forma interativa!',null,B.al,null,null,null,null,null,null)
